    false,nt"url": null,nt"notes": "These data were collected to evaluate the
    best measures of the effect ofncontaminants on the biota to be used as part of the
    National Status andnTrends Program. Sediment and benthic samples were collected
    in coastalnwaters around San Francisco Bay, specifically from the Russian River
    tonSanta Cruz. The samples were collected from November 1, 1986 to Februaryn27,
    1987. Each sample was tested for trace metal and organic compoundnconcentrations,
    organic carbon and texture. The originator's data are innMicrosoft Excel spreadsheet
    submitted by Dr. Edward Long from NOS/CEAB.nThey are documented in the NOAA technical
    memorandum nos OMA 45 (1989)ntitled "An Evaluation of Candidate Measures of Biological
    Effects fornthe National Status and Trends Program".",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
